@Aisha_traveler @qe_mania @DrEricDing @GISAID @TWenseleers Zero/Poor cross-ventilation indoors(in houses, apartments, rooms etc) are a big reason why Virus can spread so rapidly in entire families &amp; buildings

So.. try to improve your cross-ventilation by opening up windows/doors

Remember.. Virus is airborne indoors but not outdoors

